<?php

class AF {
  public AJ $aj;

  public function AFMethod(AI $data) {
    $ag = new AG;
    $ag->agProp;
    AH::$ahProp;
    $data->aiProp;
    $this->aj->ajProp;
  }
}

class AG {
  public int $agProp = 0;
}

class AH {
  public static int $ahProp = 0;
}

class AI {
  public int $aiProp = 0;
}

class AJ {
  public int $ajProp = 0;
}
